All applicants and licensees must pay fees as follows:
(1) application fee, $225;
(2) license renewal fee, $225;
(3) inactive license renewal fee, $125;
(4) biennial renewal late fee, $100;
(5) inactive license renewal late fee, $100; and
(6) supervisor application processing fee, $225.
All fees in this section are nonrefundable.
Fees collected by the board under this section must be deposited in the state government special revenue fund.
